import { GET_ALL_DOGS, GET_DOG_DETAILS, CLEAN_DOG_DETAILS } from "./action-types";

const initialState = {
    dogs: [],
    dogDetails: null,
}

const reducer = (state = initialState, action) => {
    switch(action.type) {
        case GET_ALL_DOGS:
            return {
                ...state,
                dogs: action.payload
            }
        case GET_DOG_DETAILS:
            return {
                ...state,
                dogDetails: action.payload
            }
        case CLEAN_DOG_DETAILS:
            return {
                ...state,
                dogDetails: null
            }
        default:
            return {
                ...state
            }
    }
}

export default reducer;
